import { GET_MOVIE, GET_TV } from "../actions/types";
const initialState = {
  details: {},
  similar: [],
  genres: [],
  trailer: "",
  cast: []
};

export const getMovie = () => async dispatch => {
  const res = await axios.get("");
  const data = res.data;
  dispatch({
    type: GET_MOVIE,
    payload: data
  });
};
